import ReturndAsh from './Dash';
import HashLoader from 'react-spinners/HashLoader';

// Dash board view 
export default function DAsh() {

 const [loading, setLoading] = React.useState(false);
 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (

  <div>
   {
    loading ?
     <div className='App-loading'>
      <HashLoader
       size={80}
       color={'#123abc'}
       loading={loading}
      />
     </div>
     :
     <ReturndAsh />
   };
  </div>

 );
};
